INSERT INTO `about_us` VALUES (5,'UNMATCHED CONCEPT','CHALLENGING YET ENERGIZING',NULL,'image','At Sky Park, your courage will be put to test. Nothing can satisfy your lust for adventure as a set of professional obstacle courses elevated on three levels. and the higher up you go, the more challenging it will get. So, take a deep breath and set your sails towards Sky Park to prove yourself the ultimate champ. Obstacle courses are established on four levels, Junior, Novice, Intermediate, and Expert. Each path goes another level higher than the one before and features some more challenging obstacles. No, we didn’t forget about our little ones. Children up to 5 years old have their own special route with obstacles tailored to match their age. Once you succeed to complete your mission and reach the finish line, your lips won’t refrain from keeping a smile on hold for the next couple of days.','2022-03-06 06:10:40','2022-03-06 06:10:40'),(10,'SELF ACCOMPLISHMENT IS','OUR PHILOSOPHY','assets/uploads/about_us/66171646554047.mp4','video','Diamonds are formed through millions of years of intense heat and pressure, but watch how they came out to be. It’s just the same with humans, we always learn and come out better after passing through hardships and overcoming them. That’s what we aim at spreading through Sky Park. Once you decide to cling your harness to the course, there’s only one way down and that’s right at the end of your path. But as soon as you overcome your challenge you won’t be the same person who came up; A new, more joyful, more confident being who is always willing to take the risk and prove to himself that he is stronger.','2022-03-07 10:26:46','2022-03-06 06:07:27');
